import React, { Component } from 'react';
import { Navbar, Nav, NavItem } from 'react-bootstrap';
import { Link } from "react-router-dom";
import './Navbar.css';


class NavBar extends Component {
  render () {
    return (
      <Navbar style={this.props.style} className="Navbar" fixedTop>
          <Navbar.Header>
            <Navbar.Brand>
                <a className="Navbar-header" href="/">nancy yao</a>
            </Navbar.Brand>
          </Navbar.Header>
          <Nav pullRight style={{display:"flex", flexDirection:"row"}}>
            <NavItem>
              <p className="Navbar-item">tech</p>
            </NavItem>
            <NavItem>
              <p className="Navbar-item">design</p>
            </NavItem>
            <NavItem>
              <p className="Navbar-item">sketches</p>
            </NavItem>
            <NavItem>
              <p className="Navbar-item">contact</p>
            </NavItem>
          </Nav>
      </Navbar>
    )
  }
}

export default NavBar
